import React, { useCallback, useEffect } from "react";
import { Redirect } from "react-router-dom";
import qs from "query-string";
import useIsMountedRef from "src/hooks/useIsMountedRef";

function OAuth2({ location }) {
	const isMountedRef = useIsMountedRef();
	const getOrganization = () => localStorage.getItem("organization");

	console.log(this.getOrganization());

	let { code } = qs.parse(location.search);
	console.log("OAuth2's code ", code);

	const getToken = useCallback(() => {}, [useIsMountedRef]);

	useEffect(() => {
		getToken();
	}, [getToken]);

	// return <Redirect to="/phr" />;
	return <div></div>;
}

export default OAuth2;
